import React from 'react';
import AuthorBanner from './components/AuthorBanner';
import BiographyCard from './components/BiographyCard';
import Works from './components/Works'

function App() {
  return (
    <React.Fragment>
      <AuthorBanner/>
      <BiographyCard/>
      <Works/>
    </React.Fragment>
  );
}

export default App;
